webpackJsonp([5924105280593],{533:function(A,M){A.exports={data:{pages:{internal:{content:'{"id":5,"title":"About This Toolkit","slug":"about/toolkit","template":"about.jsx","category":"about"}'},childPagesContent:{internal:{content:'{"0":{"type":"section","content":{"0":{"text":"The purpose of this toollkit","type":"header"},"1":{"text":"<p>The purpose of this toolkit is to present practical guidance to help project teams ensure that PA programmes are child-sensitive (i.e. maximize benefits for children and eliminate harm to children). This involves using child-sensitive approaches in the design, implementation, monitoring and/or evaluation phases of PA projects whenever possible.&nbsp;&nbsp;</p>\\n","type":"paragraph"}}},"1":{"type":"section","content":{"0":{"text":"Intended audience","type":"header"},"1":{"text":"<p>The intended audience for this toolkit are child poverty technical advisors/specialists (including those working on food security and livelihoods and social protection). It also includes programme managers, monitoring, evaluation, accountability and learning (MEAL) staff and field level practitioners involved in the design, implementation, monitoring and evaluation of child sensitive PA programmes.&nbsp;&nbsp;</p>\\n","type":"paragraph"}}},"2":{"0":{"type":"image","source":"data:image/jpeg;base64,","caption":"Caption of image"},"type":"section","content":{"0":{"type":"image","source":"data:image/jpeg;base64,","caption":"Children in Senegal"}}},"3":{"0":{"text":"The Case Study","type":"header"},"1":{"text":"<p><strong>This toolkit uses the example of a real Save the Children PA project in Kenya.</strong> This example is a practical case study that uses the real facts and details of this project to show the utility of the various building blocks, action steps and tools presented in this toolkit. Where necessary (i.e. where the information was not available or where necessary to ensure the toolkit’s clarity) some additional information has been added to the Kenya Case Study.</p>\\n","type":"paragraph"},"type":"section","content":{"0":{"text":"Using this Toolkit","type":"header"},"1":{"text":"<p>This toolkit presents three primary building blocks for integrating child-sensitivity into PA programmes. These are:&nbsp;</p>\\n<ul>\\n<li>Building Block A: Analysis</li>\\n<li>Building Block B: Design</li>\\n<li>Building Block C: MEAL</li>\\n</ul>\\n<p>These building blocks correspond to the typical phases of the project cycle, and therefore build on each other. This sequential structure is intended to help project teams clearly relate which building blocks are most relevant for their projects at any given point in the project cycle and to ensure that the suggested actions add value throughout the life of PA projects.&nbsp;&nbsp;</p>\\n","type":"paragraph"}}}}'
}}}},pathContext:{slug:"about/toolkit"}}}});
